(1436,	310,	'plot_layouts_1_content',	'Here we have a lovely paragraph area. It\'s very easy to read.\r\n<ul>\r\n 	<li>Text can be bullets</li>\r\n 	<li>Lots of bullets</li>\r\n 	<li>Many</li>\r\n</ul>\r\nWe can also have:\r\n<ol>\r\n 	<li>Ordered Lists</li>\r\n 	<li>With multiple items</li>\r\n 	<li>All Numbered Up</li>\r\n</ol>\r\n<blockquote>Block quotes are fine to use too</blockquote>\r\n<p style=\"text-align: center;\">Centered Text is allowed</p>\r\n<p style=\"text-align: right;\">Right aligned text is allowed too.</p>\r\nWe can also include <a href=\"http://link.com\">links.</a>\r\n\r\nThis area is included within a read more tab.\r\n\r\n<img class=\"alignnone size-full wp-image-281\" src=\"http://plot.test/wp-content/uploads/2019/11/75380544_118077336278178_2402166189221478400_o-225x166.jpg\" alt=\"\" width=\"225\" height=\"166\" />\r\n\r\n<img class=\"size-medium wp-image-277 aligncenter\" src=\"http://plot.test/wp-content/uploads/2019/11/0-610x426-300x210.jpeg\" alt=\"\" width=\"300\" height=\"210\" />\r\n\r\n<img class=\"alignright wp-image-276 size-full\" src=\"http://plot.test/wp-content/uploads/2019/11/0-1-1024x683.jpeg\" alt=\"\" width=\"1024\" height=\"683\" />'),
