(9934,	419,	'biog',	'<p class=\"p1\">This artist has used her grit and talent to propel herself into a world that not long ago would have rejected someone outside of its conventions. She continues to support more marginalised voices represented in the electronic music scene, unafraid to vocalise her political and social views, ultimately working to help diversify the community.</p>'),
