(9946,	420,	'biog',	'<!--(figmeta)eyJmaWxlS2V5IjoiZWVYUWx0VFRnanoxVUlhWXFyUGVQWW9MIiwicGFzdGVJRCI6LTEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)-->Jon Mills returns to his Northern roots for the first of the live shows performing his brand new self-produced album Dont Shaft Me.\n\nMillss music has always pursued extremes, and his production here has the quality of dry ice, a pale fog disturbed only by the rudiments of rhythmthe clack of a wood block, or the dull crack of a snare.\n\nBringing a 24-piece orchestra for 4 of the 10 shows, it it set to be his most progressive live performance to date. Not to be missed.'),
