(10230,	571,	'biog',	'<p class=\"p1\">Family has always been front-and-centre for this artist. His breakthrough 2014 EP was inspired by the funk, soul and hip-hop tapes his mum used to play in the car. Spreading organically on the strength of the music, the record finished the year on a plethora of Best of the Year lists including Pitchfork, FACT and Resident Advisor.</p>\n<p class=\"p1\">This artists rise has been stealthy but unstoppable, and the man behind it all, is now one of the biggest electronic artists of our time. 2017s album was his biggest yet, achieving a Top 5 position in the UK and nominated for best Dance/Electronic album at The GRAMMYs, cementing his breakthrough in America.</p>\nhttps://www.youtube.com/watch?v=l_RfediFJFQ'),
