(10480,	594,	'biog',	'<p class=\"p1\">Not long after their debut album in 2000, this band was signed to the larger Ninja Tune and the steady ascent continued with the release of the albums in 2003 and 2006. The release of the 2010 album was a milestone.</p>\n<p class=\"p1\">A record of epic reach and massive emotional pull, all held together by their understanding of composition and arrangement of live instruments as well as their mastery of the bleeding-edge techniques of the digital age. It was progressive, absorbing developments of the dance scenes around him, their sound had matured yet further.</p>\nhttps://www.youtube.com/watch?v=7vT4mlW4UY4'),
