(10494,	595,	'biog',	'<p class=\"p1\">This artist is a 19 year old singer/songwriter from Croydon andis the youngest in a large family, and the only child born in England rather than her native Zimbabwe. Her familys traditional Zimbabwean values meant she sometimes felt isolated from her cultural surroundings. She found solace in writing and recording music. Her limited exposure to pop music and her self taught singing/guitar meant she developed a totally unique style.</p>\nhttps://www.youtube.com/watch?v=o7u8nUFH6C0'),
