(10528,	903,	'biog',	'<p class=\"p1\">This artist has used her grit and talent to propel herself into a world that not long ago would have rejected someone outside of its conventions. She continues to support more marginalised voices represented in the electronic music scene, unafraid to vocalise her political and social views, ultimately working to help diversify the community.</p>\r\n<p class=\"p1\">Her We Still Believe events are celebratory, inclusive spaces in which various genres of electronic music are acknowledged, with performers &amp; fans all part of a truly engaging and welcoming event.</p>\r\nhttps://www.youtube.com/watch?v=l_RfediFJFQ'),
